import './App.css';
import React from 'react'
import Bio from './components/Bio';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <h1>Pablo Picasso website</h1>
        <Routes>
          <Route path='/bio' element={<Bio/>}/>
          <Route path='*' element={<Bio/>}/>
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
